import React, { Component } from "react";

class Movie extends Component {
  render() {
    console.log(this.props.movie);
    return (
      <tr>
        <th scope="row"></th>
        <td>Mark</td>
        <td>Otto</td>
        <td>@mdo</td>
      </tr>
    );
  }
}

export default Movie;
